Sean Garrett, along with Bloodshy &amp; Avant, produced &quot;Toy Soldier.&quot;  Garrett also produced at least six more unreleased songs, including the leaked &quot;Kiss Me All Over and &quot;Pull Out&quot; and the unreleased &quot;Red Carpet&quot; and &quot;Love.&quot; Of Garrett's collaboration with Spears, he notes, &quot;I've got this one record I've been holding for 10 months that everyone has tried to buy, but I stayed with Britney on it. I guarantee it will shake up the world. It's uptempo, out of control ... it's wowzers, produced by me and Bloodshy. I can't give the title yet, but the record is done and definitely what people want to hear from her.&quot;

 &quot;No disrespect to Danja, but 'Gimme More' is definitely not the best joint,&quot; said Sean Garrett, who co-produced and sang on &quot;Toy Soldier.&quot; &quot;They just warming up. I got the 'Whoop!' It's starting this artillery style of heat. It's going to be hot.&quot; Garrett said that while most of the album &quot;is definitely dance,&quot; a lot of the songs are also talking about Spears' life, &quot;how she feels, how she sees things. It's hard to stay in the pop world that long,&quot; he said. &quot;Obviously, she has something special. She's just down-to-earth. She's her. She's not trying to be nobody else but her. And she makes mistakes” we all make mistakes” but you gotta love her. She'll have the world dancing for her, if you give her an opportunity to show what she's made of.&quot;

